script: |
  super -f text -I q8473.spq | sort > q8473.out

inputs:
  - name: q8473.spq
    data: |
      SELECT DISTINCT + col1 / col1 - - tab1.col1 * col2 * col2 AS col1 FROM tab1 (FORMAT parquet) WHERE ( NULL ) BETWEEN + col1 * - col2 AND NULL;
  - name: tab1

outputs:
  - name: q8473.out
    data: |
